CREATE TABLE mytable(
   "youtuber name"    VARCHAR(49) NOT NULL PRIMARY KEY
  ,"channel name"     VARCHAR(49) NOT NULL
  ,Category           VARCHAR(20)
  ,Subscribers        VARCHAR(6) NOT NULL
  ,"Audience Country" VARCHAR(14) NOT NULL
  ,"avg views"        VARCHAR(6) NOT NULL
  ,"avg likes"        VARCHAR(6) NOT NULL
  ,"avg comments"     VARCHAR(6) NOT NULL
);
